                    { new Guid("40eb67a1-2f65-48b9-87a2-3ac9f659aad7"), 12, "Korku, Fantastik, Romantik", "İsveç", "Tomas Alfredson", "Sürekli hor görülen bir ergenin kankası vasıtasıyla hayattan, kaderden ve berbat okul arkadaşlarından hesap sormasının hikayesi 'Gir Kanıma'. Son dönem korku sineması örneklerinden klişe kullanmaması ve bir hayli özgün içeriğe sahip olmasıyla öne çıkan 'Låt den rätte komma in', Stockholm'ün varoşlarında annesiyle birlikte yaşayan küçük Oskar'ın tuhaf hikayesini anlatıyor. Kahramanımız Oskar, sık sık da şehir dışında yaşayan babasını ziyarete gitmektedir. Arkadaşları tarafından çoğu zaman aşağılanan ve sürekli alay edilen bir çocuk olan Oskar öc alacağı günlerin hayalleriyle yaşamaktadır. Bir gece soluk benizli bir kızla tanışan Oskar, Eli adındaki bu 'değişik' kızla çok yakın arkadaş olur. Birlikte güzel zaman geçirseler de Eli'ın bir sırrı vardır. Bir vampir olan Eli, Oskar'la arasındaki arkadaşlığa bunu yansıtmasa da zamanla ikilinin başına büyük dertler açılır. Son dönem Kuzey Avrupa sinemasından çıkan en çarpıcı yapıtlardan biri olan 'Gir Kanıma', sanat sinemasıyla vampir filmleri janrının başarıyla harmanlandığı yapımlardan biri.", "7.9", 114, "Gir Kanıma", "wikipedia.org", "Kåre Hedebrant, Lina Leandersson, Per Ragnar", "beyazperde.com", "https://www.youtube.com/watch?v=ICp4g9p_rgo", "https://upload.wikimedia.org/wikipedia/tr/thumb/0/02/Gir_Kan%C4%B1ma_afi%C5%9F.jpg/330px-Gir_Kan%C4%B1ma_afi%C5%9F.jpg", 2008 },
                    { new Guid("518fe0f8-b7c8-423d-ade8-de93b1aae6dc"), 18, "Dram, Gerilim", "Almanya", " Florian Henckel von Donnersmarck", "Başkalarının Hayatı, Alman sinemasının son döneminin en önemli filmlerinden biri olarak kabul görmüştür. Film iktidarın meşrutiyetini devam ettirebilmek için ülke genelinde kurduğu istihbarat servisini ve bu birim içerisinde önemli bir pozisyonda çalışan ve Bakan tarafından bir sanatçıyı takip etme görevine atanan Yüzbaşı Gerd Wiesler’in karşılaştığı oyunları konu edinir. Wiesler, gözetlediği tiyatro yazarının rejime karşı gelmediğini, şüpheli herhangi bir harekette bulunmadığını görür ve bu görevin altında başka bir amaç yattığını fark eder. Yazarın hayatına her gün daha bir fazla giren Wiesler, zamanla yazara kendisinin bile fark etmediği yardımlarda bulunur; böylece aralarında gizli bir dostluk kurulur.", "8.4", 137, "Başkalarının Hayatı", "wikipedia.org", "Ulrich Mühe, Sebastian Koch, Martina Gedeck", "beyazperde.com", "https://www.youtube.com/watch?v=YsShZNHmpGE", "https://upload.wikimedia.org/wikipedia/tr/thumb/5/5a/Ba%C5%9Fkalar%C4%B1n%C4%B1n_Hayat%C4%B1_film_afi%C5%9Fi.jpg/330px-Ba%C5%9Fkalar%C4%B1n%C4%B1n_Hayat%C4%B1_film_afi%C5%9Fi.jpg", 2006 },
                    { new Guid("745d82ba-4126-4e89-a3d9-37ce0f1fb1cf"), 12, "Dram, Savaş", "Almanya", "Paul Verhoeven", "Yahudiler için Almanya’da yaşamanın kabusa eş değer olduğu yıllarda Yahudi şarkıcı Rachel Steinn, bu korkunç baskıdan kurtulabilmek için ülkeyi terketmeye karar verir. Fakat ne yazık ki, Hollanda’ya gitmek için kaçak olarak bindiği bot, Almanlar tarafından durdurulacaktır.Bottaki herkesin öldürülmesine rağmen Rachel,şans eseri kurtulur.Ülkeyi terkedemeyen Rachel için yapacak tek bir şey kalmıştır: direnişçilere katılmak! Ellis de Vries adı ile direniş gruplarının önemli isimlerinden biri haline gelecektir.RoboCop,Temel İçgüdü gibi filmlerin de yönetmeni olan Paul Verhoeven,şimdi de İkinci Dünya Savaşı’nda yaşanan gerçek trajedilerden birine el atıyor.", "7.7", 145, "Kara Kitap", "beyazperde.com", " Carice van Houten, Sebastian Koch, Thom Hoffman", "beyazperde.com", "https://www.youtube.com/watch?v=Nm2IJkU6I-o", "https://tr.web.img4.acsta.net/pictures/bzp/03/58127.jpg", 2007 },
