                    { new Guid("be53b99b-1c84-4f06-9dbf-47e008b27699"), 18, "Dram", "Danimarka", " Thomas Vinterberg", "Birbirine sıkı sıkıya bağlı olan bir Danimarka kasabasında yaşayan Lucas, yerel bir anaokulunda çalışmaktadır. Anaokulundaki çocuklarla sağlıklı bir etkileşime sahiptir ancak ergenlik çağında olan ve eski karısıyla beraber yaşayan oğluyla ilişkisini sürdürmekte zorluklar yaşar. İş arkadaşı Nadja ise ona yakınlaşır ve bir süre sonra sevgili olurlar.Anasınıfındaki öğrencilerden biri olan Klara, Lucas'ın en yakın arkadaşı olan Theo'nun kızıdır.Abisinin Klara'ya gösterdiği pornografik fotoğraf, küçük kızın aklına kazınır ve bir gün anaokulundayken yaptığı yorumlar, anaokulu müdürünün küçük kızın Lucas tarafından cinsel tacize mağruz kaldığını düşünmesine yol açar. Daha sonra Klara ile yönlendirmeli bazı sorularla tekrar konuşulduğunda, küçük kız Lucas'a karşı açık olmayan ifadeler verir.Kasabadaki yetişkinler ise anasınıfı müdürünün Klara'nın sonraki çelişkili ifadelerini görmezden gelen istismar hikâyesine inanmaktadır.Lucas toplum tarafından pedofil olarak suçlanarak dışlanır.Arkadaşı Theo ile olan dostluğu biter.Artan baskı,Nadja ile ayrılmalarına sebep olur.Ayrıca oğlu da alenen dışlanır.Anaokulu çalışanları diğer çocuklara da yönlendirmeli sorular sorarlar ve anasınıfındaki diğer çocuklar da Lucas tarafından istismar edildiklerini söyler.Ancak çocukların ifadelerinde bahsettikleri Lucas'ın bodrumundaki detaylar, Lucas'ın masumiyetini destekler çünkü Lucas'ın evinde bodrum yoktur. Bunun üzerine Lucas, duruşmadan sonra herhangi bir suçlama olmadan serbest bırakılır.Toplum hala Lucas hakkında şüphelidir.Ancak toplumdan dışlama,bir süre sonra şiddete dönüşür.Lucas'ın köpeği Fanny öldürülür, evinin camından içeri bir kaya parçası atılır ve gıda almak için marketteyken, market çalışanları tarafından dövülür. Lucas, Noel arifesinde bir kilise ayini sırasında, Theo ile yüzleşir. Daha sonra Theo, Klara'nın uyumak üzereyken mırıldandığı özür dilerim Lucas sözünden sonra,Lucas'ın masumiyeti hakkındaki şüphelerini giderir ve Noel günü elinde yiyecek ve alkol ile barışmak için Lucas'ı ziyarete gider.Bir yıl sonra, toplumdaki gerginlikler azalmıştır.Lucas ve Nadja tekrar birliktedirler.Lucas'ın oğlu ise yerel bir avcılık topluluğuna bir yetişkin olarak kabul edilmiştir. Bu olayı kutlamak için düzenlenen bir av seferinde, görülmeyen bir kişi Lucas'a ateş eder ve onu ıskalar.Batan güneş gözüne çarparken,Lucas saldırganını teşhis edemez ve tüfeğini tekrar dolduran saldırgan gözden kaybolur.Birbirine sıkı sıkıya bağlı olan bir Danimarka kasabasında yaşayan Lucas,yerel bir anaokulunda çalışmaktadır.Anaokulundaki çocuklarla sağlıklı bir etkileşime sahiptir ancak ergenlik çağında olan ve eski karısıyla beraber yaşayan oğluyla ilişkisini sürdürmekte zorluklar yaşar.İş arkadaşı Nadja ise ona yakınlaşır ve bir süre sonra sevgili olurlar.Anasınıfındaki öğrencilerden biri olan Klara,                  Lucas'ın en yakın arkadaşı olan Theo'nun kızıdır.Abisinin Klara'ya gösterdiği pornografik fotoğraf, küçük kızın aklına kazınır ve bir gün anaokulundayken yaptığı yorumlar, anaokulu müdürünün küçük kızın Lucas tarafından cinsel tacize mağruz kaldığını düşünmesine yol açar. Daha sonra Klara ile yönlendirmeli bazı sorularla tekrar konuşulduğunda, küçük kız Lucas'a karşı açık olmayan ifadeler verir.Kasabadaki yetişkinler ise anasınıfı müdürünün Klara'nın sonraki çelişkili ifadelerini görmezden gelen istismar hikâyesine inanmaktadır.Lucas toplum tarafından pedofil olarak suçlanarak dışlanır.Arkadaşı Theo ile olan dostluğu biter.Artan baskı,Nadja ile ayrılmalarına sebep olur.Ayrıca oğlu da alenen dışlanır.Anaokulu çalışanları diğer çocuklara da yönlendirmeli sorular sorarlar ve anasınıfındaki diğer çocuklar da Lucas tarafından istismar edildiklerini söyler.Ancak çocukların ifadelerinde bahsettikleri Lucas'ın bodrumundaki detaylar, Lucas'ın masumiyetini destekler çünkü Lucas'ın evinde bodrum yoktur. Bunun üzerine Lucas, duruşmadan sonra herhang