                    { new Guid("168994ae-83f6-415b-91c4-421b1a7bc193"), 18, "Gerilim, Macera", "ABD", " Ron Howard", "Venedik'teki bir otel odasında uyanan Robert Langdon neler olduğunu ve oraya nasıl geldiğini hatırlamamaktadır. Kendisine neler olduğunu hatırlayabilmek için ona yardım etmeye çalışan doktor Sienna Brooks'la birleşirler. Langdon ve Brooks cevapları aramak için Avrupa'yı dolaşmak zorunda kalırlar. Bu kez de İtalyan ozan ve politikacı Dante'nin İlahi Komedya kitabıyla bağlantılar bulmaya başlar. Zamanla ortaya çıkan ipuçları bir felaketi işaret etmektedir. Çok zengin bir işadamı kısa bir süre içinde dünyaya veba salgınını yayacaktır. Dünyanın başına gelebilecek bu felaketi engellemenin tek yolu Landgdon'ın neler olduğunu hatırlamasıdır...Dan Brown'ın aynı adlı romanından uyarlanan filmin başrolünde Tom Hanks yer alıyor. Daha önce Brown'un Da Vinci Şifresi,Melekler ve Şeytanlar kitaplarının da uyarlamalarında ana karakter Robert Langdon'ı canlandıran oyuncuya başrolde Felicity Jones eşlik ediyor. Filmin yönetmenliği Ron Howard üstleniyor. Uyarlamanın senaryosu ise David Koepp'e ait.", "6.2", 122, "Cehennem", "wikipedia.org", " Tom Hanks, Felicity Jones, Ben Foster", "beyazperde.com", "https://www.youtube.com/watch?v=RH2BD49sEZI", "https://upload.wikimedia.org/wikipedia/tr/6/66/Inferno_%282016_film%29.png", 2016 },
                    { new Guid("59df2671-6a59-4ee3-a1cf-78133bac1f12"), 18, "Aksiyon, Casusluk, Gerilim", "İngiltere", " Sam Mendes", "MI6 ciddi bir saldırıya uğrar ve kurumun değerleri temelden sarsılır. M’e karşı sadakat testinden geçen ajan James Bond kişisel bedelleri ağır olsa da, tehdidi bulup her ne pahasına olursa olsun yok etmelidir. Zira MI6’yı ciddi riske sürükleyen isim Silva adında gözü kara, gizemli bir adamdır...Sinema tarihinin en uzun soluklu aksiyon film serisi olan gizli ajan 007 James Bond'un nefes kesen macerası bu sefer Türkiye, Çin ve İngiltere ekseninde geçiyor.Serinin 23.filmi olan Skyfall'da 2000'li yılların son Bond'u olarak Daniel Craig'i izlerken ünlü aktöre M rolünde seyircinin alıştığı üzere Judi Dench,Silva rolünde Javier Bardem,hukümet görevlisi Mallory olarak Ralph Fiennes, seksi Bond kadınları olarak ajan Eve rolünde Naomie Harris ve Severine rolünde Bérénice Marlohe eşlik ediyor.Yönetmen koltuğunda Sam Mendes'in oturduğu filmin Türkiye dışındaki diğer çekim mekanları arasındaysa Şangay, Londra ve İskoçya’nın kuzey bölgeleri yer alıyor.", "7.1", 143, "Sktfall", "wikipedia.org", "Daniel Craig, Judi Dench, Javier Bardem", "beyazperde.com", "https://www.youtube.com/watch?v=6kw1UVovByw", "https://upload.wikimedia.org/wikipedia/tr/thumb/e/e9/Skyfall_film_posteri.jpg/330px-Skyfall_film_posteri.jpg", 2012 },
                    { new Guid("7317ee9e-4099-4f8e-a359-9e6df65ca41f"), 12, "Gerilim, Macera", "ABD", "Alfonso Cuarón", "Dr. Ryan Stone zeki bir tıp mühendisidir ve emekliliğinden önce son görevine çıkan yetenekli ve deneyimli astronot Matt Kowalsky'nin yönetimindeki mekikte ilk uzay yolculuğuna çıkar. Herşey yolunda gibi görünürken rutin bir keşif yürüyüşü sırasında bir felaket yaşanır. Mekik çarpan bir cisim sonucu paramparça olur. İki bilim insanı uzay boşluğunda yapayalnız kalırlar. Yeryüzü ile iletişimleri tamamen kopmuştur ve sonsuz karanlıkla başbaşadırlar. Şimdi korkunun yerini panik alır, üstelik var olan sınırlı oksijenleri de gitgide tükenmektedir. İkili eve, dünyaya dönüş yolunu bulabilecek midir?Y Tu Mamá También,Son Umut,Harry Potter ve Azkaban Tutsağı gibi filmlerin yönetmeni ve ortak senaristi olarak tanıdığımız Meksikalı sinemacı Alfonso Cuarón'ın yönetmenliğini üstlendiği bilim-kurgu geriliminin başrollerini ise Sandra Bullock ve George Clooney paylaşıyor.", "7.7", 91, "Yerçekimi", "behence.com", "Sandra Bullock, George Clooney, Ed Harris", "beyazperde.com", "https://www.youtube.com/watch?v=OiTiKOy59o4", "https://mir-s3-cdn-cf.behance.net/project_modules/disp/a41b4b11636617.560fb0d69096d.jpg", 2013 },
                    { new Guid("e0790725-ab6c-4208-a10d-8b9c9664b349"), 18, "Aksiyon, Bilimkurgu", "ABD", "George Miller", "Mad Max: Fury Road'da, zorlu geçmişi Mad Max’i hayatta kalmak için en iyi yolun yalnız olmak gerektiğine inandırmıştır. Yine de bir şekilde kendini Furiosa adlı liderlerinin peşinde çorak topraklardaki savaş ortamından, sürekli kaçarak hayatta kalmaya çalışan bir grubun arasında bulur. Yaşadıkları ortamı zalimce yöneten Immortan Joe’dan kaçmaktadırlar ve Joe kendisinden çalınan ve yeri doldurulamayacak derecede önemli kaybının peşindedir. Post-apokaliptik türünün yaratıcısı ve efsanevi “Mad Max” filmlerinin ardındaki usta yönetmen George Miller'ın bir kez daha yönetmen koltuğunda oturduğu Mad Max: Fury Road geri dönüyor! Charlize Theron ve Tom Hardy'nin rol aldığı film, serinin dördüncü bölümü. Filmin diğer başrollerinde; Nicholas Hoult, Hugh Keays-Byrne, Nathan Jones, Josh Helman, Rosie Huntington-Whiteley, Riley Keough, Zoë Kravitz yer alıyor.", "8.1", 120, "Mad Max", "beyazperde.com", " Tom Hardy, Charlize Theron, Zoë Kravitz", "beyazperde.com", "https://www.youtube.com/watch?v=hEJnMQG9ev8", "https://tr.web.img4.acsta.net/pictures/15/04/27/14/48/596979.jpg", 2015 },
                    { new Guid("f863f7aa-7e18-4b2f-b643-3f32508b8d24"), 18, "Polisiye, Gerilim", "ABD", " Quentin Tarantino", "Venedik'teki bir otel odasında uyanan Robert Langdon neler olduğunu ve oraya nasıl geldiğini hatırlamamaktadır. Kendisine neler olduğunu hatırlayabilmek için ona yardım etmeye çalışan doktor Sienna Brooks'la birleşirler. Langdon ve Brooks cevapları aramak için Avrupa'yı dolaşmak zorunda kalırlar. Bu kez de İtalyan ozan ve politikacı Dante'nin İlahi Komedya kitabıyla bağlantılar bulmaya başlar. Zamanla ortaya çıkan ipuçları bir felaketi işaret etmektedir. Çok zengin bir işadamı kısa bir süre içinde dünyaya veba salgınını yayacaktır. Dünyanın başına gelebilecek bu felaketi engellemenin tek yolu Landgdon'ın neler olduğunu hatırlamasıdır...Dan Brown'ın aynı adlı romanından uyarlanan filmin başrolünde Tom Hanks yer alıyor. Daha önce Brown'un Da Vinci Şifresi,Melekler ve Şeytanlar kitaplarının da uyarlamalarında ana karakter Robert Langdon'ı canlandıran oyuncuya başrolde Felicity Jones eşlik ediyor. Filmin yönetmenliği Ron Howard üstleniyor. Uyarlamanın senaryosu ise David Koepp'e ait.", "8.9", 154, "Ucuz Roman", "wikipedia.org", " John Travolta, Samuel L. Jackson, Uma Thurman", "beyazperde.com", "https://www.youtube.com/watch?v=s7EdQ4FqbhY", "https://upload.wikimedia.org/wikipedia/en/3/3b/Pulp_Fiction_%281994%29_poster.jpg", 1994 }
