                {
                    { new Guid("297529a5-39e0-4294-aa28-a98e0f7e143b"), 12, "Dram", "İngiltere, ABD", " Tom Hooper", "Zoraki Kral (orijinal adı: The King's Speech), Tom Hooper tarafından yönetilen ve David Seidler tarafından senaryosu yazılan 2010 tarihsel drama. Film, 2010 Toronto Uluslararası Film Festivali, People's Choice Ödülü kazandı ve on dört BAFTA (yedisini kazandı), on iki Akademi (dördünü kazandı) ve yedi Altın Küre ödülüne aday gösterildi.Rolüyle Altın Küre kazanan Colin Firth'in canlandırdığı VI. George, kekemeliğinin üstesinden gelmek için alışılmışın dışında bir konuşma terapisti Lionel Logue'a(canlandıran: Geoffrey Rush) gider.Birlikte çalışma sürecinde iki adam,arkadaş olurlar ve kardeşinin tahttan çekilmesinden sonra Kral,II.Dünya Savaşı'nın başında radyo yayını yapması konusunda Logue'a bel bağlar.David Seidler,gençliği boyunca kendi kekemeliğinin üstesinden gelmesinden sonra VI.George'u okumaya ve bilgili hayal gücünü kullanmaya başladı, erkeklerin ilişkisi hakkında yazdı. Filmin çekilmesinden dokuz hafta önce Logue'un not defteri keşfedildi ve buradaki alıntılar senaryoya dahil edildi.Ana çekimler, Aralık 2009 ile Ocak 2010'un başında Londra ile Birleşik Krallık'taki diğer mekânlarda gerçekleşti.Film,Amerika Birleşik Devletleri'nde 10 Aralık 2010 tarihinde ve Birleşik Krallık'ta 7 Ocak 2011 tarihinde gösterildi.Ağır dili nedeniyle başlarda Birleşik Krallık'ta '15' reyting ile sınıflandırıldı fakat eleştirilerden sonra bu reyting düşürüldü.Zoraki Kral,Birleşik Krallık gişesinde üst üste üç haftada en yüksek kazanan film oldu ve günümüze kadar 100 milyon İngiliz sterlininden fazla kazanç elde etti.Film,yaygın olarak görsel stil, sanat yönetmenliği ve oyunculuk alanında film eleştirmenlerinden beğeni topladı.Diğer yorumcular,filmin anlattığı tarihsel olayların temsil edilişini tartıştı.", "8.0", 118, "Zoraki Kral", "amazon.com", "Colin Firth, Helena Bonham Carter, Derek Jacob", "wikipedia.org", "https://www.youtube.com/watch?v=EcxBrTvLbBM", "https://images-na.ssl-images-amazon.com/images/S/pv-target-images/a3c6dde6684d7ef66558395e19db0af911b5c1c6062d5411598255e11b28ef83._UY500_UX667_RI_V_TTW_.jpg", 2010 },
                    { new Guid("4c113c9a-e2fa-4596-b165-4360a0d108ea"), 12, "Savaş, Aksiyon, Dram", "ABD", "Kathryn Bigelow", "Batılı eleştirmenler tarafından olumlu karşılanan bu filmin en büyük dezavantajı Ortadoğu'daki savaşın diğer tarafına tepeden bakan ve oryantalist bir bakış açısını taşıması gösterilebilir. Herkesin potansiyel düşman ve her objenin de ölümcül bomba olduğu Irak’ta, elit askerler dünyanın en zor görevlerinden birinde yer alır. Sıcak savaşın ortasında bombaları imha etmekle yükümlüdürler. Takım lideri William James, hem bu yaygın bombalardan hem de psikolojik ve duygusal etkilenmelerle uğraşmaktadır. James’in iki askeri kendini cürretkarca savaşın ortasına atar. James ise ölümü aldırmadığı için askerlerine yardıma gider. Yeni vahşi liderini korumaya çabalayan adamlar, şehri kaosa sürekler. Mark Boald, Irak savaşındaki askerlerin yaşadığı deneyimlerin ilk defa bir filmde yer aldığını, görüntülerin CNN’deki gibi gerçekçi olduğunu ve birçok savaş filminin savaş bitmeden gösterilmediğini belirtiyor. Günümüzde de devam eden savaş dolayısıyla, filmin güçlü oyuncu kadrosunun savaşı hissederek sergilediği etkileyici performans, eleştirmenler tarafından tam not aldı. Film ilk kez 65. Venedik Film Festivalinde seyirciyle buluştu. Film SIGNIS ödülü dahil birçok ödüle layık görüldü. Yine de entelektüel sinema yazarlarının bir kısmının 'işgalci unsur' meselesine pek değinilmeden filmde işlenen şiddetin tek yanlı ele alınmasını eleştirmesi de unutulmamalı.", "7.5", 131, "Ölümcül Tuzak", "afi.com", "Jeremy Renner, Anthony Mackie, Brian Geraghty", "beyazperde.com", "https://www.youtube.com/watch?v=AIbFvqFYRT4", "https://prdaficalmjediwestussa.blob.core.windows.net/images/2022/04/AFIMC22_THE-HURT-LOCKER_4.jpeg", 2009 },
                    { new Guid("7f389b6c-afb1-411c-aef0-4b2348a22357"), 18, "Dram, Western", "ABD", " Joel Coen, Ethan Coen", "İhtiyarlara Yer Yok, Coen kardeşler yapımıdır ve dört Oscar kazanmalarını sağlamıştır. Bir başyapıt olarak kabul görmektedir. Llewelyn Moss, bir olay yerinde bulduğu çantayı alır ve başını hiç ummadığı bir belaya sokar. Artık peşinde bir kiralık katil vardır. Moss bir Vietnam gazisidir ve bir şekilde uyuşturucu olaylarının ortasında soruna dönüşen bir meseleye karışır. Peşindeki katil Anton Chigurh planı konusunda kararlıdır çünkü işini yarım bıramak niyetinde değildir. İşin için çok sayıda masum insanın ve suçluların da karışacağı soluk soluğa bir takip başlayacaktır.", "8.2", 122, "İhtiyarlara Yer Yok", "collider.com", "Tommy Lee Jones, Javier Bardem, Josh Brolin", "beyazperde.com", "https://www.youtube.com/watch?v=38A__WT3-o0", "https://static1.colliderimages.com/wordpress/wp-content/uploads/2021/09/no-country-for-old-men-ending.jpg", 2007 },
                    { new Guid("e9ec6e2c-e7fd-43aa-8af2-ab56b6feb69b"), 12, "Gerilim", "Kore", " Bong Joon Ho", "Park Ailesi'yle tanışın: soyla gelen servetin klasik bir tablosu. Diğer yanda ise Kim Ailesi, sokak zekası bakımından zengin ama başka hiçbir zenginliğe sahip değil. Şans veya kader olsun, bu iki ev halkı bir şekilde bir araya gelir ve Kim ailesi altın bir fırsatın varlığını hemen sezer. Kolej çağındaki Ki-woo tarafından manipülasyon konusunda yetiştirilen Kim çocukları, öğretmen ve sanat terapisti görevleriyle kendilerini Park ailesinin arasına çabucak yerleştirir. Kim'ler “vazgeçilmez” lüks hizmetler sunarken, Parklar ise habersizce evlerindeki her şeyi Kim ailesine kaybetmektedir. Ancak kısa sürede bu düzen bir tehditle karşılaşır. Asalak bir misafir Kim ailesinin yeni keşfettikleri konforu tehdit eder hale geldiğinde, vahşi ve zorlayıcı bir üstünlük mücadelesi patlak verir. Bu mücadele Kim ve Park aileleri arasındaki kırılgan ekosistemi yıkmakla tehdit etmektedir.", "8.5", 132, "Parazit", "twitter.com/moviegrafmg", "Song Kang-Ho, Woo-sik Choi, Park So-Dam", "beyazperde.com", "https://www.youtube.com/watch?v=AXn4Will3aU", "https://pbs.twimg.com/media/EckSb0VWsAA5KbH.jpg", 2019 },
                    { new Guid("f98cab69-6290-43ba-92be-ce953734058d"), 12, "Dram, Romantik", "Fransa", " Michel Hazanavicius", "1920'li yılların sonunda Hollywood sinema sektörünü kökünden değiştirecek 'teknolojik' bir devrim yaşandı. Ses, 'henüz hiçbir şey duymadınız' repliği ile film pelikülüne bir daha hiç ayrılmamak üzere girdi. Fakat sinema sektöründe yaşanan bu devrim boyutundaki bu değişim pek çok insanın mesleğini ve kariyerini de derinden sarstı.Dönemin en karizmatik aktörleri arasında yer alan George Valentin(Jean Dujardin) de sesin beklenmedik biçimde sinema perdesine yansımasından payına düşeni alıyor.yanı başında boy gösteren taze ve güzel oyuncu Peppy Miller'ın ise aklı fikri şöhrette.2011 Cannes Film Festivali'nin en gözde yapımlarından olan The Artist, başrol oyuncusu Jean Dujardin'e George Valentin performansı ile 'En İyi Erkek Oyuncu' ödülünü kazandırdı.Film sinema sanatının sessiz dönemine bir saygı duruşu niteliğinde diyalogsuz,sessiz,siyah - beyaz ve saniyede 22 kare ile çekildi.Altın Palmiye adayları arasında da olan filmin yazarlığını ve yönetmenliğini ise Michel Hazanavicius üstleniyor.", "7.9", 140, "Artist", "lefigaro.fr", "Jean Dujardin, Bérénice Bejo, John Goodman", "beyazperde.com", "https://www.youtube.com/watch?v=YB9Oq0hn5KY", "https://i.f1g.fr/media/figarofr/orig/2012/02/22/f8db9518-5d7e-11e1-b170-b72124fbbea9-493x328.jpg", 2011 }
                });

            migrationBuilder.InsertData(
                table: "Seris",
                columns: new[] { "Id", "Age", "Category", "Country", "Creators", "Explane", "Imdb", "Minute", "Name", "PictureSource", "Starring", "TextMovieSource", "Trailer", "Url", "Year" },
                values: new object[,]
                {
                    { new Guid("2d3c119b-6acb-4eff-8c4f-ec0af27c000a"), 18, "Aksiyon, Bilimkurgu", "ABD", "Lana Wachowski, Lilly Wachowski", "Saygın bir yazılım şirketinde çalışan Thomas Anderson (Keanu Reeves), gecelerini 'Neo' adı altında program kırarak ve Matrix'i araştırarak geçirir. Esrarengiz şekilde Trinity ve Morpheus ile tanışan Neo, yaşadığı dünyanın aslında beyninde gerçekleşen bir simülasyondan ibaret olduğunu öğrenir ve kendini bu durumdan kurtarmak için Morpheus'un önderliğindeki ekibe katılır. Neo gerçek dünyada ilk nefesini aldıktan sonra simülasyona tekrar girerek Matrix'in ne olduğunu kavrayacak ve kurtarılma nedenini öğrenerek gelişen olaylar çerçevesinde yeni kimliğini tanımaya çalışacaktır.Filmdeki olaylar çok ileri bir tarihte teknolojinin son derece gelişmiş olduğu,yapay zekaya sahip makinelerin yaratılmış olduğu bir dünyada geçmektedir.Bu dünyada makineler ve insanlar arasında ortaya çıkmış,savaş sonucunda insan ırkı makineleri yenebilmek için onların enerji kaynağı olan güneş ışınlarının dünyaya inmesini engellemek adına,gökyüzünü kimyasal silahlarla siyah bulutlar oluşturmak suretiyle kapatmıştır.Bunun sonucunda enerji ihtiyacını karşılayamayan makineler yeni enerji kaynakları bulmaya yönelir ve insan vücudunun çok iyi bir enerji motoru olduğunu fark ederler.Böylece insanları köle olarak enerji üretimi için kullanmaya başlarlar ve herhangi bir isyan durumundan kaçınmak için insanların zihinlerini meşgul edecek bir program tasarlarlar.Bunun sonucunda köle insanlar aslında bilinçsiz bir şekilde uyurken zihinleri makinelere bağlı bir şekilde Matrix programının içerisinde her şeyden habersiz sanal bir dünyada yaşamaya devam ederler.Filmin başkahramanı Neo bu insan tarlalarında uyanır ve gerçek dünyada insanların yaşadığı tek yer altı şehri olan Zion'a götürülür ve gerçek dünyaya alıştıktan sonra Morpheus'un ekibiyle beraber makinelere karşı savaşmaya başlar..", "8.7", 135, "Matrix 1", "wikipedia.org", "Keanu Reeves, Laurence Fishburne, Carrie-Anne Moss", "wikipedia.org", "https://www.youtube.com/watch?v=m8e-FF8MsqU", "https://upload.wikimedia.org/wikipedia/tr/thumb/3/36/Matrix-film.jpg/330px-Matrix-film.jpg", 1999 },
                    { new Guid("42df5ba4-cc74-4a56-8039-d73aab03168b"), 18, "Korku, Gerilim", "ABD", "Wes Craven", "Bir lise öğrencisi olan Casey tuhaf bir telefon alır. Telefonun öteki ucundaki sesi tanımamaktadır. Bir süre sonra yaşanan bir cinayet üzerine polis ve medya olayın üzerine gitmeye başlar. ‘Hayalet surat’ adı verilen bir katil, çevresinde gördüğü gençleri birer birer öldürmektedir. Korku filmlerinin belli klişelerle örüldüğünü düşünen bir grup genç ise, naklen yaşadıkları bir korku filminin içerisinde hayatta kalmaya çalışacaktır. Katille bir kedi-fare oyununa tutuşacaklardır. Wes Craven’ın kendi filmografisiyle ve korku türüyle inceden alay ettiği ancak buna müteakip korkutmayı da başardığı filminin başrollerinde Drew Barrymore, Roger Jackson ve Neve Campbell gibi oyuncuları görmek mümkün.", "7.4", 111, "Çığlık 1", "wikipedia.org", "Neve Campbell, Courteney Cox, David Arquette", "beyazperde.com", "https://www.youtube.com/watch?v=AWm_mkbdpCA", "https://upload.wikimedia.org/wikipedia/en/8/86/Scream_%281996_film%29_poster.jpg", 1996 },
                    { new Guid("499c406c-77d7-45cd-8572-598a034d13ce"), 12, "Bilimkurgu", "ABD", "Peter Jackson", "Yüzüklerin Efendisi: Yüzük Kardeşliği, dünyanın kaderini değişterecek olan yüzükten kurtulmak için verilen mücadeleyi konu ediyor. Yıllar önce üretilen ve Orta Dünya topraklarına kandan başka hiçbir şey getirmeyen yüzüklerin sonuncusu, üretiminden yüz yıllar sonra ortaya çıkar. Amcasının kendisine emanet ettiği yüzüğün nelere kadir olduğundan habersiz olan Frodo, büyücü Gandalf'ın anlattıkları sonrasında dehşete kapılır. Bu yüzükten ve müstakbel savaşlardan kurtulmanın tek yolu, gücünü toplamaya çalışan Sauron'u da engellemek için bu yüzüğü yok etmektir. Yüzüğü yok edilebileceği tek yer olan Mordor'a götürmek için kendini feda eden savaşçılardan oluşan bir ekip oluşturulur. Çok uzun ve çetin geçecek olan yolculuk başlar. Orta Dünya'nın kaderi, bu insanların ellerindedir.", "8.8", 178, "Yüzüklerin Efendisi  1", "wikipedia.org", " Elijah Wood, Sean Astin, Ian McKellen", "beyazperde.com", "https://www.youtube.com/watch?v=V75dMMIW2B4", "https://upload.wikimedia.org/wikipedia/tr/e/e6/Y%C3%BCz%C3%BCklerinEfendisi%27Y%C3%BCz%C3%BCkKarde%C5%9Fli%C4%9Fi-film.jpg", 2001 },
                    { new Guid("b98bd09c-c595-4382-b4d6-5c61f5d4c9a2"), 12, "Aksiyon, Fantastik", "ABD", " Gore Verbinski", "Karayip Korsanları: Siyah İnci’nin Laneti, genç bir kızı kurtarmaya çalışan korsan Jack Sparrow ile demirci Will Turner'ın maceralarını anlatıyor. Yerel vali Weatherby Swann'ın 12 yaşındaki kızı Elizabeth, Jamaica'ya yaptığı deniz yolculuğu esnasında bir gemi enkazıyla karşılaşırlar. Bu enkazdan kurtulabilen tek kişi küçük Will'dır. Elizabeth küçük çocuğun boynundaki altın madalyondan onun bir korsan olduğunu anlar, bu yüzden madalyonu alarak saklar. Yıllar sonra Elizabeth, azılı bir korsan olan Barbossa tarafından kaçırılır. Çılgın ve iyi yürekli bir korsan olan Jack Sparrow ise Elizabeth'in çocukluk arkadaşı Will Turner'la bir olur ve kızı kurtarmaya çalışırlar. Ancak bu gizemli madalyon hayalet gemiyi harete geçirerek gizemli incinin lanetini canlandıracaktır.", "8.1", 143, "Karayıp Korsanları 1", "wikipedia.org", "Johnny Depp, Geoffrey Rush, Keira Knightley", "beyazperde.com", "https://www.youtube.com/watch?v=naQr0uTrH_s", "https://upload.wikimedia.org/wikipedia/tr/thumb/0/0e/Pirates_of_the_Caribbean_movie.jpg/330px-Pirates_of_the_Caribbean_movie.jpg", 2003 },
                    { new Guid("c6905c46-356c-4f59-a9ca-cab4a5fbcaf1"), 12, "Bilimkurgu, Komedi", "ABD", "Robert Zemeckis", "Doktor Emmett Brown'un evine gelen Marty McFly, gitarını dev bir hoparlöre bağlar. Gitarının teline dokunduğunda hoparlörün büyüklüğünden kaynaklanan sesten dolayı geriye zıplar. Ardından telefon çalar. Arayan Dr. Emmett Brown'dur. Marty'ye geceleyin yanına gelmesini söyler. Okula geç kaldığını fark eden Marty, kaykayına binip okula gider. Müdürden azar işitip geç kağıdı alır. Grubuyla birlikte okulun müzik seçmelerine katılır. Ancak jüri üyeleri onları, müziklerinin çok gürültülü olduğu gerekçesiyle reddeder. Çıkışta sevgilisi Jennifer ile, babasının arabası ile dolaşacaklarını söyler. Evine gider. Arabayı ödünç alan Biff Tanen, (Thomas F. Wilson) Marty'nin babası George McFly'ın (Crispin Glover) arabası ile kaza yapmıştır. Marty buna çok sinirlenir. Uyanıp Dr. Brown'un yanına kamera ile giden Marty, Brown'un Delorean DMC-12 model bir arabadan zaman makinesi yaptığını görür. Zamanda yolculuk yapabilmesi için plütonyum gereken araba, saatte 88 mil hıza ulaşınca geçmişe veya geleceğe gider. Brown, köpeği Einstein'i geleceğe gönderir. Araba geri gelir, Einstein de içindedir ve Einstein yolculuğa çıkmadan önce Dr. Brown'un onun boynuna taktığı saatle Dr. Brown'un kolundaki saat arasında 1 dakikalık bir fark vardır, böylece ilk zaman yolculuğu denemesi başarı ile gerçekleşmiştir. Ardından Brown'un plütonyumdan bomba yapma vaâdiyle kandırdığı Libyalı teröristler gelir, Brown'u vururlar. Marty arabaya binip oradan kaçar, fakat o sırada 88 mil hıza çıkan Marty kendini 1955 yılında bulur. İlk olarak arabayı bir reklam tabelasının arkasına saklar. Şehre ulaştığında, 1955 yılına geldiğini anlar. Bir restauranta gider. Orada babası ile karşılaşır. Biff, arkadaşları ile George'a sataşır. Marty dolaşırken George'un Lorraine'i gözetlediğini görür. George ağaçtan düşer ve ona tam araba çarpacakken, Marty onu kurtarır. Araba ona çarpar ve bayılır. Ayıldığında kendisini annesinin yanında bulur, kötü bir rüya gördüğünü söyler. Gözlerini açtığında kendisini annesinin gençliğinin yanında bulur. Annesi odadan çıkar ve Marty pantolonunu giyer. Aşağıya inip Lorraine'nin ailesi ile yemek yer. Annesi ona romantik bir ilgi gösterir. Marty bu durumdan çok utanır. Doktor Brown'ın yanına gider. Brown en başta Marty'ye inanmaz. Ancak Marty onu ikna eder. Elindeki bir fotoğrafa bakar. Bir bölümü silinmiştir. Brown ona durumu açıklar. Marty, babasını arabanın çarpmasından kurtararak, anne ve babasının tanışmasını engellemiştir. Eğer babası ve annesini birleştirmeyi başaramazsa yok olacaktır. 1985 yılına geri dönebilmesi için gereken plütonyum yerine de saat kulesine düşecek yıldırımın gücüne ihtiyaç vardır.Marty, George ile buluşarak onun Lorraine ile tanışmasını sağlamaya çalışır.Ancak George'un belalısı Biff Tanen da Lorraine'i istiyordur.Marty,George'un Lorraine'i okuldaki dans gecesine davet etmesini söyler.Ancak George bunun mümkün olmadığını söyleyince,Marty çareyi George'u kandırmakta bulur. Plütonyumdan korunmak için tasarlanmış kıyafeti giyip George'un yanına gider.Ona Darth Vader olduğunu ve Lorraine'i partiye davet etmesi gerektiğini söyler. Çok korkan George bunu kabul etmek zorunda kalır. George, tam Lorraine'i davet edecekken Biff çıkagelir ve ona sataşmaya başlar.Marty,Biff'i onlardan uzak tutmaya çalışır. Biff'e bir yumruk atar.Biff ve arkadaşları arabalarına binip onun peşine düşerler.Marty kaykaya binip onlardan kaçar.Biff ve arkadaşları,Marty'i ellerinden kaçırdıklarında bir gübre kamyonuna çarparlar. Bu olay ile birlikte Lorraine'nin Marty'e ilgisi daha çok artmıştır. Marty yeni bir plan yapar. O Lorraine'i partiye götürecektir,ardından da zarar vermeye çalışacaktır.Bu sırada George gelip Marty'i durduracak ve Lorraine ona aşık olacaktır. Parti günü geldiğinde Marty araba ile Lorraine'ni alır.Okulun dışında Lorraine ile arabada oturan Marty'nin planı Biff yüzünden bozulur. Biff'in arkadaşları Marty'i bir arabaya kilitlerler. Biff de Lorraine'ne taciz etmeye çalışır.Plana uygun olarak arabada Marty'nin olduğunu sanan George, Biff'e Lorraine'nin yanından çekilmesini söyler. Biff, George'un kolunu kıvırır ve onunla dalga geçer.Bu sırada bir arabada kilitli kalan Marty'e, partide çalacak olan müzisyenler yardım eder. Marty hemen George'a yardım etmeye gider.Biff'in kolunu kavradığı George, onun Lorraine'e tokat atmasına sinirlenir.Yumruğunu sıkar ve Biff'in suratına en sert yumruğunu atar. Biff oracıkta yere yığılır. Artık George'un Marty'e ihtiyacı yoktur. Marty, Biff'in arkadaşlarının kendisini aradıklarını görür.Marty'yi arabadan çıkaran müzisyenlerden birinin eli zarar görmüştür ve bu da gitar çalmasına engel olur. Bu yüzden Marty gitar çalmayı kabul eder. Partide Rock'n roll çalan Marty'nin eli yavaşça yok olmaya başlar. Çünkü sınıf arkadaşlarından biri George'u itip,yanındaki Lorraine'i almıştır. İlk önce oradan uzaklaşan George geri gelip çocuğu itip Lorraine ile dans eder. Marty de sorunun hallolduğuna sevinip Johnny B. Goode şarkısını çalar. İlk başta bu şarkı çok beğenilse de Marty'nin yapmaya başladığı garip hareketler insanların bunu garipsemesine neden olur.Marty oradan uzaklaşıp Dr.Brown'un yanına gider. Ona bir mektup vermeye çalışır ama Brown bunu kabul etmez. Arabanın geleceğe gidebilmesi için, saat kulesine düşecek yıldırıma ihtiyaç vardır. Marty arabaya elektrik kablosuna değeceği bir çubuk takıp beklemeye başlar. Araba biraz geç çalışır, fakat saat kulesinin tepesindeki Dr. Brown bu sırada yıldırımı çekecek olan kabloyu yanlışlıkla koparır. Marty'nin sürdüğü araba tam gelecekken aşağıya iner ve sorunu çözer.Yıldırım düşer ve Marty 1985'e geri döner. Hemen Dr. Brown'ın yanına gidip ölmesine engel olmaya çalışır ancak Libyalılar,Brown'ı yine vurur. Marty koşarak Brown'ın yanına gider.Bu duruma çok üzülen Marty'nin yanındaki Brown kendine gelir. Marty'nin yazdığı mektubu okumuştur ve kurşunlardan korunmak için yelek giymiştir.Ardından Marty evine gider.Babası ünlü bir yazardır.Biff de onların hizmetçisidir.Kız kardeşinin peşinde bir sürü erkek vardır ve erkek kardeşi de saygın bir işte çalışıyordur.Marty ayrıca hayalindeki arabaya da sahip olmuştur.Marty arabasının yanındayken sevgilisi Jennifer gelir.İkisi konuşurlarken Dr.Brown gelir ve onları gelecekte büyük bir sorunun beklediğini söyleyip tekrar zamanda yolculuğa çıkarlar.", "8.5", 116, "Geleceğe Dönüş 1", "wikipedia.org", "Michael J. Fox,Christopher Lloyd,Lea Thompson,Crispin Glover,Thomas F.Wilson", "wikipedia.org", "https://www.youtube.com/watch?v=qvsgGtivCgs", "https://upload.wikimedia.org/wikipedia/tr/3/33/Back_to_the_Future_%28film%2C_1985%29.jpg", 1985 }
